  e82.style.padding = '12px';
  e82.style.height = '60px';
  e82.style.width = '60px';
  e82.style.background = '#e9e9e8f0';
  e82.style.overflowX = 'hidden';
  e82.style.overflowY = 'hidden';
  e82.style.right = '25px';
  e82.style.top = '25px';
  e82.style.position = 'absolute';
  e82.style.transition = '300ms all ';
  document.querySelector('body').appendChild(e82);

  let e820 = document.querySelector('body>li.nav-item>a.nav-link');
  e820.style.display = 'flex';
